import{_ as e,c as t,a5 as s,o as n}from"./chunks/framework.Dzz2jpra.js";const h=JSON.parse('{"title":"常见问题","description":"","frontmatter":{"title":"常见问题","sidebar_position":7},"headers":[],"relativePath":"nitwikit/docs-java/process/plugin/more/faq.md","filePath":"nitwikit/docs-java/process/plugin/more/faq.md","lastUpdated":1730488911000}'),i={name:"nitwikit/docs-java/process/plugin/more/faq.md"};function l(d,a,o,p,r,c){return n(),t("div",null,a[0]||(a[0]=[s('<h1 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h1><p>一些常见的插件安装问题</p><h2 id="缺失依赖项" tabindex="-1">缺失依赖项 <a class="header-anchor" href="#缺失依赖项" aria-label="Permalink to &quot;缺失依赖项&quot;">​</a></h2><p>特征:</p><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>[00:00:00] [Server thread/WARN] Could not load &#39;plugins/MyAwesomePlugin-1.0.0.jar&#39; in folder &#39;plugins&#39;</span></span>\n<span class="line"><span>[00:00:00] [Server thread/WARN] org.bukkit.plugin.UnknownDependencyException: Unknown/missing dependency plugins: [Vault]. Please download and install these plugins to run &#39;MyAwesomePlugin&#39;.</span></span></code></pre></div><p>这意味着你安装的插件缺少一个依赖项。在这个情况下，依赖项是指你必须安装的另一个插件，以便第一个插件能够运行</p><p>这是在告诉你，为了加载 <code>MyAwesomePlugin</code> ，你必须首先安装 <code>Vault</code>.</p><h2 id="无效-plugin-yml" tabindex="-1">无效 <code>plugin.yml</code> <a class="header-anchor" href="#无效-plugin-yml" aria-label="Permalink to &quot;无效 `plugin.yml`&quot;">​</a></h2><p>特征:</p><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>[00:00:00] [Server thread/WARN] Could not load &#39;plugins/MyAwesomePlugin-1.0.0.jar&#39; in folder &#39;plugins&#39;</span></span>\n<span class="line"><span>[00:00:00] [Server thread/WARN] org.bukkit.plugin.InvalidDescriptionException: Invalid plugin.yml</span></span></code></pre></div><p>这意味着你下载的不是一个有效的插件.这通常是由以下原因之一引起的:</p><ul><li>你下载的插件根本不是插件，而是 Forge、Fabric 或类似软件的 mod。这些在插件端上无法运行</li><li>插件下载不完整,重新下载即可</li></ul><h2 id="java-版本低" tabindex="-1">Java 版本低 <a class="header-anchor" href="#java-版本低" aria-label="Permalink to &quot;Java 版本低&quot;">​</a></h2><p>特征</p><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>org.bukkit.plugin.InvalidPluginException: java.lang.UnsupportedClassVersionError: me/profelements/dynatech/DynaTech has been compiled by a more recent version of the Java Runtime (class file version 65.0), this version of the Java Runtime only recognizes class file versions up to 61.0</span></span></code></pre></div><p>这通常是因为你安装 Java 版本过低</p><p><code>has been compiled by a more recent version of the Java Runtime (class file version &lt;Class 版本&gt;)</code> 就是你需要更新到的 Java 版本</p><p>常用 Class Version 对应表</p><table tabindex="0"><thead><tr><th>Java 版本</th><th>Class 文件版本</th></tr></thead><tbody><tr><td>Java 7</td><td>51.0</td></tr><tr><td>Java 8</td><td>52.0</td></tr><tr><td>Java 11</td><td>55.0</td></tr><tr><td>Java 16</td><td>60.0</td></tr><tr><td>Java 17</td><td>61.0</td></tr><tr><td>Java 21</td><td>65.0</td></tr><tr><td>Java 22</td><td>66.0</td></tr><tr><td>Java 23</td><td>67.0</td></tr><tr><td>Java 24</td><td>68.0</td></tr></tbody></table><h2 id="循环依赖" tabindex="-1">循环依赖 <a class="header-anchor" href="#循环依赖" aria-label="Permalink to &quot;循环依赖&quot;">​</a></h2><p>指的是 A 依赖 B,B 依赖 C,C 依赖 A,导致 Paper 无法判断加载顺序</p><p>解决方案: 添加参数<code>-Dpaper.useLegacyPluginLoading=true</code> 即可</p><h2 id="重复插件" tabindex="-1">重复插件 <a class="header-anchor" href="#重复插件" aria-label="Permalink to &quot;重复插件&quot;">​</a></h2><p>特征:</p><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>[00:00:00] [Server thread/WARN] Ambiguous plugin name `Essentials&#39; for files `plugins/EssentialsX-2.19.4.jar&#39; and `plugins/Essentialsx-2.20.0-dev.jar&#39; in `plugins&#39;</span></span></code></pre></div><p>这意味着你有两个同名插件.确保你一次只安装每个插件的单一版本。删除重复插件的旧版本，并重新启动你的服务器.</p>',26)]))}const g=e(i,[["render",l]]);export{h as __pageData,g as default};
